import react from 'react';

function Card(props) {
  console.log(props);
  return (
    <div className='cards'>
      <div className='card'>
        <img src={props.simg} alt='Web_Poster' className='card__img' />
        <div className='car__info'>
          <span className='car__category'>{props.sname}</span>
          <h3 className='card__title'>{props.stitle}</h3>
          <a href={props.slink} target='_blank'>
            <button class='button'>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  );
}

export default Card;
